// Generate a behaviour based on sine wave
sineBehaviour = () => {
  var out = [];
  var hz = 1/60;
  for (var i = 0; i<1500; i++) {
    
    // get sine value
    var s = Math.sin(Math.PI * hz * i);

    // put in 0-180 range
    var sn = ((s + 1) / 2) * 180;

    out.push(Math.round(sn))
  }
  return out;
}

// Generate a completely random behaviour
function randomBehaviour() {
  var out = []
  for (var i = 0; i<1500; i++) {
    out.push(Math.random() * 180);
  }
  return out;
}

// Maps a 0.0-1.0 range to 0-180
function mapBehaviour(b) {
  var out = [];
  b.forEach(function (element) {

    out.push(element/65);
  });
  return out;
}

